function parseColorTags(input) {
    const colorTagRegex = /<color=(#[a-fA-F0-9]{6})>(.*?)<\/color>/g;
    let result = '';
    let lastIndex = 0;
    input.replace(colorTagRegex, (match, color, text, offset) => {
        result += input.slice(lastIndex, offset);
        result += `<span style="color:${color};">${text}</span>`;
        lastIndex = offset + match.length;
    });
    result += input.slice(lastIndex);
    return result;
}
