function parsePlayerJoinMessage(message) {
    const regex = /\[(\d+)]\s(\S+)/;
    const match = message.match(regex);
    if (match) {
        let username = match[2];
        if (username.includes('</color>')) {
            username = username.split(']</color>')[1];
        }
        return {
            actorId: parseInt(match[1], 10),
            username: username,
        };
    }
    return null;
}
