const spinThreshold = 800;
const spinThresholdPitch = 200;

const lastYawByViewId = {};
const lastPitchByViewId = {};
const spinBotCounter = {};

function detectSpinBot(tmpYaw, viewId) {
    let isUsingSpinBot = false;

    if (!lastYawByViewId[viewId]) {
        lastYawByViewId[viewId] = null;
    }
    const lastYaw = lastYawByViewId[viewId];
    if (lastYaw !== null) {
        let yawDifference = Math.abs(tmpYaw - lastYaw);

        if (yawDifference > 1800) {
            yawDifference = 3600 - yawDifference;
        }

        if (yawDifference > spinThreshold) {
            if (yawDifference === 800) {
                console.warn(` Possible SpinBot detected for ViewId ${viewId}! `);
                isUsingSpinBot = true;
            }
        }
    }

    lastYawByViewId[viewId] = tmpYaw;
    return isUsingSpinBot;
}


