function isInVision(localPos, localYaw, targetPos, maxFov = 3100, maxDistance = 6757) {
    const dx = targetPos.x - localPos.x;
    const dz = targetPos.z - localPos.z;
    const dy = targetPos.y - localPos.y;  // Height difference

    // Calculate direction to target in radians (only XZ plane)
    let targetYaw = Math.atan2(dx, -dz) * (180 / Math.PI) * 10;

    // Normalize both yaws to 0-3600 range
    targetYaw = ((targetYaw % 3600) + 3600) % 3600;
    localYaw = ((localYaw % 3600) + 3600) % 3600;

    // Calculate the smallest angle difference between the two directions
    let diff = ((targetYaw - localYaw + 1800) % 3600) - 1800;

    // Calculate the horizontal distance to the target
    const distance = Math.sqrt(dx * dx + dz * dz);

    // Dynamically adjust the FOV based on the horizontal distance
    let dynamicFov = Math.min(maxFov, (distance / 10) * 15);  // Scale FOV with a higher factor for large distances

    // Optionally cap the FOV if distance exceeds maxDistance
    if (distance > maxDistance) {
        dynamicFov = maxFov;  // Use the maximum FOV if the distance is too large
    }

    // Now check that the target is not too far vertically
    const maxHeightDifference = 500; // Allow a 500 unit vertical range
    if (Math.abs(dy) > maxHeightDifference) {
        console.log("Target is too high or low to be in vision.");
        return false;
    }

    // Check if the target is within our dynamic field of view
    return Math.abs(diff) < (dynamicFov / 2);
}

