        const voiceStreamer = new VoiceStreamHandler(200);

        // Handles audio data conversion from Float32Array to base64
        function convertAudioToBase64(audioData) {
            // Create a buffer view to process the float audio data
            const pcmData = new Float32Array(audioData);

            // Convert to 16-bit PCM (common for voice transmission)
            const pcm16 = new Int16Array(pcmData.length);
            for (let i = 0; i < pcmData.length; i++) {
                // Convert float (-1.0 to 1.0) to int16 (-32768 to 32767)
                const s = Math.max(-1, Math.min(1, pcmData[i]));
                pcm16[i] = s < 0 ? s * 0x8000 : s * 0x7FFF;
            }

            // Convert to base64
            const buffer = new ArrayBuffer(pcm16.length * 2);
            const view = new DataView(buffer);
            for (let i = 0; i < pcm16.length; i++) {
                view.setInt16(i * 2, pcm16[i], true); // true = little endian
            }

            const binary = '';
            const bytes = new Uint8Array(buffer);
            for (let i = 0; i < bytes.byteLength; i++) {
                binary += String.fromCharCode(bytes[i]);
            }

            return btoa(binary);
        }

        let audioContext;
        let audioStream;
        let audioSource;
        let audioProcessor;

        async function setupAudioCapture() {
            try {
                if (voiceStreamer.isCapturing) {
                    console.log("Audio capture is already running");
                    return true;
                }

                audioStream = await navigator.mediaDevices.getUserMedia({
                    audio: {
                        echoCancellation: true,
                        noiseSuppression: true,
                        autoGainControl: true
                    }
                });

                audioContext = new (window.AudioContext || window.webkitAudioContext)();
                audioSource = audioContext.createMediaStreamSource(audioStream);

                audioProcessor = audioContext.createScriptProcessor(4096, 1, 1);

                audioProcessor.onaudioprocess = function(e) {
                    if (voiceStreamer.isCapturing) {
                        const audioData = e.inputBuffer.getChannelData(0);

                        const hasSoundData = audioData.some(sample => Math.abs(sample) > 0.01);

                        if (hasSoundData) {
                            const base64Audio = convertAudioToBase64(audioData);

                            voiceStreamer.enqueueAudio(base64Audio);
                        }
                    }
                };

                audioSource.connect(audioProcessor);
                audioProcessor.connect(audioContext.destination);

                voiceStreamer.isCapturing = true;

                console.log("Audio capture initialized successfully");
                return true;
            } catch (error) {
                console.error("Failed to initialize audio capture:", error);
                return false;
            }
        }

        // Stop audio capture
        function stopAudioCapture() {
            if (!voiceStreamer.isCapturing) {
                console.log("Audio capture is not running");
                return true;
            }

            try {
                // Disconnect audio nodes
                if (audioProcessor) {
                    audioProcessor.disconnect();
                    audioSource.disconnect();
                }

                // Stop all audio tracks
                if (audioStream) {
                    audioStream.getTracks().forEach(track => track.stop());
                }

                // Close audio context if supported
                if (audioContext && audioContext.state !== 'closed' && audioContext.close) {
                    audioContext.close();
                }

                // Update status
                voiceStreamer.isCapturing = false;
                console.log("Audio capture stopped");
                return true;
            } catch (error) {
                console.error("Error stopping audio capture:", error);
                return false;
            }
        }

        // Pause audio capture without releasing resources
        function pauseAudioCapture() {
            if (!voiceStreamer.isCapturing) {
                console.log("Audio capture is not running");
                return false;
            }

            voiceStreamer.isCapturing = false;
            console.log("Audio capture paused");
            return true;
        }

        // Resume audio capture after pause
        function resumeAudioCapture() {
            if (voiceStreamer.isCapturing) {
                console.log("Audio capture is already running");
                return false;
            }

            // Check if we have an audio context that's not closed
            if (audioContext && audioContext.state !== 'closed') {
                voiceStreamer.isCapturing = true;
                console.log("Audio capture resumed");
                return true;
            } else {
                // If no active audio context, start a new capture
                return setupAudioCapture();
            }
        }

        // Expose controls to global scope
        window.voiceControls = {
            start: setupAudioCapture,
            pause: pauseAudioCapture,
            resume: resumeAudioCapture,
            stop: stopAudioCapture,
            adjustDelay: (ms) => voiceStreamer.setDelay(ms),
            getStatus: () => voiceStreamer.getQueueStatus()
        };

