function waitForUnityInstance(callback, checkInterval = 100, timeout = 10000) {
    const startTime = Date.now();
    const checkUnityInstance = () => {
        if (
            typeof unityGameInstance !== 'undefined' &&
            unityGameInstance !== null &&
            typeof unityGameInstance.SendMessage === 'function'
        ) {
            console.log('Unity instance is ready!');
            window.ProximitySDK.SendUnityMessage = unityGameInstance.SendMessage;
            window.ProximitySDK.GetUnityModule = () => {
                return unityGameInstance.Module;
            };
            window.ProximitySDK.InjectionModule = unityGameInstance.Module;
            window.ProximitySDK.CrashGame = unityGameInstance.Quit;
            callback();
        } else if (Date.now() - startTime > timeout) {
            console.error('Timeout: Unity instance not ready.');
        } else {
            setTimeout(checkUnityInstance, checkInterval);
        }
    };
    checkUnityInstance();
}

